INSERT INTO `animal` (`id`, `parent1_id`, `parent2_id`, `species_id`, `enclosure_id`, `image_id`, `name`, `description`) VALUES
(1, NULL, NULL, 1, 1, 5, 'winnie', ' célèbre pour sa personnalité douce, son innocence, et son amour inconditionnel pour le miel,habitant dans la fôret des rêves bleus il est reconnaissable à sa fourrure brune et son museau noir'),
(2, NULL, NULL, 2, 2, 6, 'norm', 'norm est un grand ours polaire au pelage blanc et épais, caractéristique de son espèce. Ses yeux sont expressifs, reflétant sa personnalité curieuse et pleine d\'énergie'),
(3, NULL, NULL, 3, 3, 7, 'kerchak', 'kerchak est un gorille massif et imposant, avec une fourrure sombre et épaisse ,ses yeux expriment souvent la sagesse, la fermeté, mais aussi une certaine mélancolie,il a une cicatrice distinctive sur son œil droit, donnant à son apparence une aura intimidante,kerchak assume le rôle de chef de la tribu des gorilles dans la jungle, et son attitude est souvent sérieuse et protectrice envers les membres de son groupe.'),
(4, NULL, NULL, 4, 4, 8, 'césar', 'césar est un chimpanzé mâle exceptionnellement intelligent et évolué,physiquement, il a une fourrure brun foncé et des traits faciaux expressifs qui démontrent une gamme d\'émotions. Ses yeux sont particulièrement perçants et révèlent son intelligence et sa compréhension du monde qui l\'entoure'),
(5, NULL, NULL, 5, 5, 9, 'po', 'po est un panda géant, reconnaissable par son pelage noir et blanc caractéristique. Il a des yeux ronds et expressifs,son amour pour la nourriture est un trait distinctif, en particulier pour les bamboos'),
(6, NULL, NULL, 6, 6, 10, 'sherkhan', 'sherekhan est un tigre imposant au pelage orange strié de noir, ses yeux sont perçants et émettent une aura de danger. il a une démarche gracieuse et puissante, reflétant à la fois sa beauté physique et sa férocité. Son rugissement  grave et menaçant , souvent accompagnée d\'un ronronnement sinistre, ajoute à son impression intimidante.'),
(7, NULL, NULL, 7, 7, 11, 'scar', 'scar est un lion mince aux yeux verts et à la crinière sombre, caractérisée par une cicatrice distincte sur son œil gauche. la cicatrice lui a valu son nom et contribue à son apparence menaçante. sa fourrure est plus sombre que celle de son frère, mufasa.ses mouvements sont souvent félins et gracieux, soulignant son intelligence et sa ruse'),
(8, NULL, NULL, 8, 8, 12, 'bagheera', 'bagheera est une grande panthère noire au pelage lisse et brillant, ses yeux jaunes sont perçants, exprimant à la fois sagesse et autorité, il se déplace avec une grâce silencieuse et une puissance prédatrice, reflétant sa nature de prédateur. bagheera est souvent dépeint comme étant élégant '),
(9, NULL, NULL, 9, 9, 13, 'melman', 'il a une silhouette élancée, une fourrure jaune pâle avec des taches brunes, et de grands yeux expressifs'),
(10, NULL, NULL, 10, 10, 14, 'sudan', 'sudan était un rhinocéros blanc du Nord, une sous-espèce du rhinocéros blanc, caractérisée par sa bouche large et carrée adaptée pour brouter de l\'herbe'),
(11, NULL, NULL, 11, 11, 15, 'motomoto', 'Physiquement, Motomoto est plus grand que les autres hippopotames il a une fourrure gris foncé avec des taches plus claires Son apparence imposante est accentuée par une crinière hérissée et il aime être admiré par les autres animaux'),
(12, NULL, NULL, 12, 12, 16, 'marahute', 'marahute est une grande aigle femelle dorée. Elle est majestueuse et impressionnante, avec des plumes dorées qui brillent au soleil.'),
(13, NULL, NULL, 13, 13, 17, 'pazze', 'description'),
(14, NULL, NULL, 14, 14, 18, 'merlin', 'description'),
(15, NULL, NULL, 15, 15, 19, 'dumbo', 'dumbo est un éléphanteau  aux grandes oreilles disproportionnées par rapport à sa petite taille. Ses yeux sont grands et expressifs, reflétant sa nature douce et innocente. dumbo a une peau grise et lisse, et ses grandes oreilles sont souvent utilisées pour créer une impression de maladresse et de vulnérabilité'),
(16, NULL, NULL, 16, 16, 20, 'julien', 'Son pelage est gris et blanc, et il a de grands yeux ronds et expressifs. Julien est souvent représenté avec une démarche légère et dansante, ajoutant à son charme comique.'),
(17, NULL, NULL, 17, 17, 21, 'ghost', 'descrption à définir'),
(18, NULL, NULL, 18, 18, 22, 'Niska', 'il a une allure décontractée et désinvolte, avec des plumes hirsutes et des expressions faciales amusantes'),
(19, NULL, NULL, 19, 19, 23, 'tictac', 'Le crocodile Tic-Tac est un grand crocodile vert avec un corps long et effilé. Son nom est dérivé du son régulier de la tic-tac d\'une horloge mécanique, ce qui est du au claquement de ses crocs'),
(20, NULL, NULL, 20, 20, 24, 'rango', 'description ');
